B.Mt=new A.eA("Datos generales del evento","<p><p>Lema: <a href='#'>Living Worship</a></p></p><p><p>Fecha: <a href='#'>del 30 de Mayo al 01 de Junio.</a></p></p><p><p>Lugar de las programaciones: <a href='#'>Carpa Movil . UPeU - Sede Lima</a></p></p>Lugar de campamento: <a href='#'>\xc1reas verdes de la UPeU, Sede Lima - cercano a la carpa m\xf3vil.</a>",B.aq)
B.Mn=new A.eA("\xbfQu\xe9 es el congreso joven APCE?",'La Asociaci\xf3n Peruana Central Este organiza el Congreso Joven "Living Worship" con el prop\xf3sito de fortalecer la fe, el liderazgo y la misi\xf3n de los j\xf3venes adventistas. Este evento ser\xe1 un espacio de adoraci\xf3n, capacitaci\xf3n y compromiso con el evangelismo, consolidando el trabajo con la Escuela Sab\xe1tica Joven (Maranata Class) y realizando el lanzamiento de Misi\xf3n Caleb 2025.',B.aq)
B.Mm=new A.eA("P\xfablico destinatario","<p><p>1. j\xf3venes de las iglesias locales, directores de Maranata Class.</p></p><p><p>2. Distritales, regionales y coordinadores de j\xf3venes.</p></p>3. Ancianos y pastores distritales, relacionados al trabajo de j\xf3venes.",B.aq)
B.Ms=new A.eA("Objetivos","<p><b>Objetivo General:</b> Fomentar una experiencia de adoraci\xf3n aut\xe9ntica y fortalecer el liderazgo y la misi\xf3n de los j\xf3venes adventistas a trav\xe9s de capacitaciones, din\xe1micas y el compromiso con el evangelismo.</p><p></p><b>Objetivos Espec\xedficos:</b></p><p><p>\u2022 Inspirar a los j\xf3venes a vivir una adoraci\xf3n que trascienda y se refleje en su estilo de vida.</p></p><p><p>\u2022 Capacitar a los j\xf3venes en liderazgo y discipulado a trav\xe9s del  Maranata Class.</p></p><p>\u2022 Lanzar oficialmente Misi\xf3n Caleb, impulsando la participaci\xf3n joven en el evangelismo y servicio a los dem\xe1s.</p></p><p><p>\u2022 Fortalecer el sentido de comunidad y pertenencia entre los j\xf3venes adventistas.</p></p>\u2022 Promover el estudio de la Biblia y la formaci\xf3n de l\xedderes de impacto misionero.",B.aq)
B.Mk=new A.eA("Din\xe1mica del evento","<p><p>El congreso se desarrollar\xe1 en diversas sesiones que incluir\xe1n:</p></p><p><p><b>\u2022 Mensajes Inspiracionales:</b> Temas sobre adoraci\xf3n aut\xe9ntica, liderazgo joven y misi\xf3n.</p></p><p><p><b>\u2022 Semiplenarias de Capacitaci\xf3n:</b> Espacios para desarrollar habilidades de liderazgo, evangelismo y discipulado.</p></p><p><p><b>\u2022 Misi\xf3n en Acci\xf3n:</b> Lanzamiento de Misi\xf3n Caleb con proyectos espec\xedficos de impacto social.</p></p><p><p><b>\u2022 Espacios de Adoraci\xf3n y Testimonio:</b> Experiencias de j\xf3venes comprometidos con la misi\xf3n y la adoraci\xf3n.</p></p><b>\u2022 Consolidaci\xf3n del Maranata Class:</b> Capacitaci\xf3n en el estudio b\xedblico y dinamismo de la Escuela Sab\xe1tica Joven.",B.aq)
B.Mr=new A.eA("\xbfPor qu\xe9 la UPEU?","<p><p>El congreso se llevar\xe1 a cabo en la Universidad Peruana Uni\xf3n (UPEU), ubicada en el kil\xf3metro 19.5 de la Carretera Central. Esta sede ha sido elegida por varias razones clave:</p></p><p><p><b>\u2022 Amplias \xe1reas verdes:</b> Espacios abiertos que favorecen un ambiente de comuni\xf3n y actividades al aire libre.</p></p><p><p><b>\u2022 Infraestructura adecuada:</b> La UPEU cuenta con una carpa m\xf3vil que puede albergar a una gran cantidad de personas, garantizando comodidad para los asistentes.</p></p><p><p><b>\u2022 Seguridad:</b> La universidad es un espacio cerrado y controlado, lo que brinda tranquilidad a los participantes y organizadores.</p></p>\u2022 El clima a fines de mayo e inicios de junio  son favorables y sin temperaturas extremas. Poca probabilidad de llluvia.",B.aq)
B.Mj=new A.eA("Prerrequisitos para participar","<p><p>\u2022 Tener como m\xednimo 16 a\xf1os cumplidos hasta mayo del 2025.</p></p><p><p>\u2022 Ser miembro bautizado.</p></p><p><p>\u2022 Ser director JA o estar en el liderazgo JA (l\xedder GP,  L\xedder Maranata Class, L\xedder de Misi\xf3n Caleb, etc.).</p></p>\u2022 Estar registrado y asegurado en el S-JA.",B.aq)
B.Mw=new A.eA("Inscripciones","<p><p>Las inscripciones ya est\xe1n abiertas y se cerrar\xe1n a la media noche del d\xeda 04 de mayo de 2025. Contacta a tu director o pastor  local.</p></p><p><p>Valor de la inscripci\xf3n completa: s/70.00 soles \u2013 incluye: participaci\xf3n del evento, chaleco, morral, pin de colecci\xf3n e identificaci\xf3n.</p></p>Se realizar\xe1 via Sistema de Gesti\xf3n del Ministerio Joven - S-JA. Cada participante debe contactarse con su regional.",B.aq)
B.Mx=new A.eA("Clima","<p><p>En esta epoca del a\xf1o, el clima en \xd1a\xf1a, Lima es templado; sin embargo, por las noches suele ser fr\xedo y con viento.</p></p>Frazada/manta y casaca son esenciales para una mejor estad\xeda.",B.aq)
B.Ml=new A.eA("Acreditaci\xf3n","<p><p>1. La acreditaci\xf3n se realizar\xe1 a partir de las 8:00 a.m del d\xeda 30/05/2025.</p></p><p><p>2. Es obligatorio la presentaci\xf3n de un documento oficial con foto al momento de la acreditaci\xf3n.</p></p><p><p>3. En la acreditaci\xf3n se entregar\xe1n los materiales y la identificaci\xf3n del evento. Adem\xe1s se le indicar\xe1 el lugar de acampar.</p></p>4. Podr\xe1 ingresar al evento solo quien est\xe1 inscrito y con la identificaci\xf3n de la pulsera oficial.",B.aq)
B.Mp=new A.eA("Indicaciones acerca de la alimentaci\xf3n","<p><p>Cada regi\xf3n podr\xe1 gestionar su alimentaci\xf3n siguiendo las siguientes indicaciones:</p></p><p><p>a. La alimentaci\xf3n es exclusivamente locto-ovo-vegetariana, sin excepciones.</p></p><p><p>b. Se podr\xe1 tener hasta dos cocinas por regi\xf3n.</p></p><p><p>c. La ubicaci\xf3n de las cocinas ser\xe1n en un lugar indicado previamente. No podr\xe1n instalarse en otro lugar no autorizado.</p></p><p><p>d. Los responsables de las cocinas deber\xe1n llevar bolsas de limpieza grandes para que cada d\xeda su espacio quede limpio y los desechos en los lugares designados.</p></p>e. Los responsables de las cocinas deber\xe1n estar atentos a la programaci\xf3n para dar los alimentos en los horarios designados y sus participantes est\xe9n puntuales en las actividades.",B.aq)
B.Mq=new A.eA("Indicaciones acerca del campamento/alojamiento","<p><p>1. El participante tiene la opci\xf3n de buscar alojamiento particular o acampar en el \xe1rea designada de la UPeU - Sede Lima.</p></p><p><p>2. Pondremos a disposici\xf3n \xe1reas debidamente designadas y se\xf1alizadas para acampar.</p></p><p><p>3. En la acreditaci\xf3n, el acampante recibir\xe1 sus materiales y la indicaci\xf3n de d\xf3nde acampar\xe1.</p></p><p><p>4. Ser\xe1 importante llevar al evento una carpa mediana o peque\xf1a, una bola de dormir y opcionalmente una colchoneta o colch\xf3n inflable.</p></p><p><p>5. Si desea puede traer un candado peque\xf1o para el cierre de su carpa.</p></p><p><p>6. Habr\xe1n ba\xf1os, duchas y lavaderos para atender a los acampantes.</p></p>7. Al final del evento, el participante deber\xe1 recoger sus cosas y limpiar el \xe1rea en donde acamp\xf3.",B.aq)
B.Mv=new A.eA("Vestimenta","<p><p>El viernes de noche, todos los l\xedderes investidos deben vestir el uniforme B del Ministerio Joven.</p></p><p><p>El s\xe1bado de ma\xf1ana los l\xedderes investidos usar\xe1n el uniforme A del MJ.</p></p><p><p>El s\xe1bado por la tarde todos deber\xe1n vestir el polo de: Misi\xf3n Caleb. (Puede ser de cualquier edici\xf3n)</p></p><p><p>El s\xe1bado de noche puede utilizar el polo MRNT.</p></p>En caso de no ser un l\xedder investido sugerimos el uso de polos relacionados al Ministerio Joven: Oyim, JA, Misi\xf3n Caleb, etc.",B.aq)
B.Mo=new A.eA("Carrusel de actividades","<p><p>1. Los participantes estar\xe1n divididos en grupos para realizar actividades en carrusel. Los grupos estar\xe1n divididos por colores, de acuerdo con la pulsera que recibir\xe1n.</p></p><p><p>2. Los participantes podr\xe1n participar de las <a href='#'>semi plenarias</a> y feria JA en los horarios designados.</p></p><p><b>Semi plenarias</b></p><p><a href='#'>Cada participante asistir\xe1 a dos semi plenarias que se realizar\xe1n en los lugares designados de la UPeU.</a> El ingreso a los lugares designados ser\xe1 hasta agotar aforo.</p></p><p><b>Feria JA</b></p>Este espacio comprender\xe1 visitas a los stands, feria de misiones y proyectos. All\xed habr\xe1 una variedad de actividades creadas para que el participante tenga una experiencia que lo marque. La feria estar\xe1 disponible desde el Viernes a las 14:00 hs hasta las 17:30 hs. El s\xe1bado aperturar\xe1 a las 18:00 hs y domingo desde las 7:30 hs.",B.aq)
